import Link from 'next/link';
import Header from 'header.js';

const Index = () => (
	<div>
		<header className="site-header">
            <div className="logo">
                <h1><link href="/"><a>Logo</a></link></h1>
            </div>
        </header>
		<Link href="/about">
			<a title="About us">About us</a>
		</Link>
		<p>Hello buddy!</p>
	</div>
);

export default Index;
